    v.push_back(a[i]);
  }
  sort(v.begin(), v.end());
  v.erase(unique(v.begin(), v.end()), v.end());
  for (int i = 0; i < n; i++)
    a[i] = lower_bound(v.begin(), v.end(), a[i]) - v.begin();  
    
  vector<int> dp(n), dp2(n);
  memset(t, 0, sizeof(t));
  for (int i = 0; i < n; i++) {
    dp[i] = get(0, a[i]-1) + 1;
    upd(a[i], dp[i]);
  }
  memset(t, 0, sizeof(t));
  for (int i = n - 1; i >= 0; i--) {
    dp2[i] = get(0, a[i]-1) + 1;
    upd(a[i], dp2[i]);
  }
  
  int ans = 1;
  for (int i = 0; i < n; i++) ans = max(ans, dp[i]+dp2[i]-1);
  cout << ans << "\n";
  
  return 0;
}

